import Navbar from "../components/Navbar";
import ParticlesBackground from "../components/Particle";

import Particle from "./Particle";

function About(){
    return (
      <section id="about">
        <h1 className="lfh1">About Us</h1>
        <p className="about-desc">
        Our platform serves as a bridge between those who have lost items and those who have found them. 
        By leveraging AI algorithms, we're able to analyze descriptions and images provided by users to match 
        lost items with their corresponding found counterparts. This streamlined approach not only saves time but 
        also increases the likelihood of successful reunions.
        But ReclaimIt is more than just a lost and found service. 
        It's a community where individuals come together to support one another in times of need.
        Whether you've misplaced your keys, left behind a cherished memento, or found a valuable item on the street, 
        ReclaimIt is here to help.
        Join us in our mission to make lost items a thing of the past. 
        Together, we can reclaim what's lost and restore peace of mind to those who need it most.
        </p>
        <footer>
        <p>Copyright &copy; 2024  Designed and Built by <a href="https:">ANONYMOUS</a></p>
        </footer>
      </section>

    );
}
export default About;
export function Home() {
  return (
    <main>
      <Navbar />
      <div className="particle-container">
        <ParticlesBackground />
      </div>
      <div className="hero">
        <h1>RECLAIM IT <br /><span style={{ fontSize: '30px', color: 'white' }}>Where    Lost   meets   Found,  Seamlessly!</span> </h1>
        <a href="/find">
          <button>Let's Find Your Item</button>
        </a>
      </div>
      <About />
    </main>
  );
}
